import React, { Component } from 'react';
import axios from 'axios';

class Graph extends Component {

  componentWillMount() {
    axios({
        method: 'get',
        url: '/administration/domains',
        auth: {
          username: process.env.REACT_APP_BAUSR,
          password: process.env.REACT_APP_BAPWD
        }
    })
    .then(response => {
      console.log(response);
    })
  }

  render() {
    return (
      <div className="system_graph">
          <h1>System Graph</h1>
      </div>
    )
  }
}

export default Graph;
